function pack(entities) {
  const buf = new ArrayBuffer(entities.length * 1);
  const view = new DataView(buf);
  entities.forEach((entity, i) => {
    view.setUint8(i, (entity.id << 3) | entity.size);
  });
  return buf;
}

function unpack(buf) {
  const view = new DataView(buf);
  const entities = [];
  for (let i = 0; i < view.byteLength; i++) {
    const entity = {
      id: view.getUint8(i) >> 3,
      size: view.getUint8(i) & 0x07
    };
    entities.push(entity);
  }
  return entities;
}
```
In the `pack` function, we create a new ArrayBuffer with a size of `entities.length * 1` bytes, since each entity takes up 1 byte of space. We then create a new DataView for the ArrayBuffer, which allows us to read and write different data types at specific byte offsets in the buffer.

We then use the `forEach` method to iterate over each entity in the `entities` array. For each entity, we use the `setUint8` method of the DataView to write the packed value of the entity (the id shifted 3 bits to the left, OR'd with the size) to the buffer at the current index.

In the `unpack` function, we create a new DataView for the given buffer, and an empty `entities` array to store the unpacked entities.

We then use a `for` loop to iterate over each byte in the buffer. For each byte, we use the `getUint8` method of the DataView to extract the packed value of the entity. We then shift the id 3 bits to the right to extract it, and use a bitwise AND with 0x07 to extract the size.

Finally, we create a new entity object with the extracted id and size, and push it to the `entities` array. Once the loop is finished, we return the `entities` array.

